import React from "react";
import {
  BrowserRouter as Router,

  Route,

} from "react-router-dom";



import './App.css';
import Header from './components/Header'
import NotesListPages from './pages/NotesListPages'
function App() {
  return (
    <Router>
    <div className="App">
    <Header />
    <Route path="/" exact component={NotesListPages}/>
    </div>
    </Router>
  );
}

export default App;
